import { styled } from "styled-components";


const Wrapper = styled.section`

.inner{
    width:50%;
    margin:auto;
    padding:20px;
}
.year{
    width:100%;
    margin: 0 auto;
}
.year input{
    width:50px;
    padding:10px;
    margin: 20px 0;
    
}
.

`

export default Wrapper;
